`}]},{id:"m_types",title:"2. Les Types de Donnes",description:"Listes, Enregistrements et Tables.",snippets:[{id:"lists_records",title:"Listes {} et Records []",description:"Les briques de base du M.",code:`// Une Liste (List) : Entre accolades {}
